import Details from "./comp/Details";
import './App.css';
import Colorchooser from "./comp/Colorchooser";

import Test from "./comp/Test";
import Wordcount from "./comp/Wordcount";


function App(props) {
  return (
    <div className='App'>

      <Details/>
      <Test/>
      <Colorchooser/>
      <div>
        <Wordcount/>
      </div>
    </div>
);
}


export default App;
